import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
import React, { useEffect } from "react";
import { useParams } from "react-router-dom";

export default function RaceTable() {
  const params = useParams();
  useEffect(() => {}, [params]);

  function createData(
    id: number,
    lane: number,
    firstName: string,
    lastName: string,
    category: string,
    club: string
  ) {
    return { id, lane, firstName, lastName, category, club };
  }

  const rows = [createData(1, 1, "Bram", "Sikkens", "SEN_H", "KCCM")];

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Lane</TableCell>
            <TableCell align="right">Firstname</TableCell>
            <TableCell align="right">LastName</TableCell>
            <TableCell align="right">Category</TableCell>
            <TableCell align="right">Club</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.id}
              sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
            >
              <TableCell>{row.lane}</TableCell>
              <TableCell align="right">{row.firstName}</TableCell>
              <TableCell align="right">{row.lastName}</TableCell>
              <TableCell align="right">{row.category}</TableCell>
              <TableCell align="right">{row.club}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
